// Skills.js
import React from "react";

const Skills = () => {
  return (
    <section className="section-image" id="skills">
      <div className="img-overlay"></div>
      <div className="container">
        <div className="row">
          <div className="col-md-12 section-heading">
            <h2>Skills</h2>
            <p className="lead">Programming Languages Used</p>
            <hr />
          </div>
        </div>
        <div className="row">
          {[
            { icon: "fa-brands fa-js", title: "JavaScript", description: "I leverage the power of JavaScript as a frontend tool to enhance the user experience, ensuring seamless website navigation and an intuitive interface that captivates users and keeps them engaged." },
            { icon: "fa-brands fa-html5", title: "HTML", description: "I harness the versatility of HTML to craft visually stunning and interactive web pages that not only captivate users but also seamlessly guide them through the website's flow." },
            { icon: "fa-brands fa-css3-alt", title: "CSS", description: "I wield the magic of CSS to weave together style and substance, transforming raw HTML elements into visually captivating masterpieces." },
            { icon: "fa-brands fa-java", title: "Java", description: "I utilize Java's backend capabilities to craft scalable and efficient server-side solutions for dynamic web applications." },
            { icon: "images/cplusplus-svgrepo-com.svg", title: "C++", description: "I rely on C++ for its unmatched speed and versatility. Leveraging its low-level control and optimization features, I engineer solutions that outperform those built with other languages." },
            { icon: "fa-brands fa-git", title: "GIT", description: "Git is my trusted companion, guiding me through the labyrinth of version control with ease and precision." },
          ].map((skill, index) => (
            <div className="col-md-4 text-center" key={index}>
              {skill.icon.includes('fa-') ? (
                <i className={`${skill.icon} fa-4x`} id="custom"></i>
              ) : (
                <img className="custom-icon" src={skill.icon} alt={`${skill.title} Icon`} id="custom" />
              )}
              <h2>{skill.title}</h2>
              <p>{skill.description}</p>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Skills;
